    public int lengthOfLongestSubstring(String s) {

        if (s == null || s.length() == 0)
            return 0;
        Set<Character> characterList = new HashSet<>();

        int position = 0;
        int maxLen = 0;
        for (int window = 0; window < s.length(); window++) {

            char c = s.charAt(window);
            while (characterList.contains(c)) {
                char c1 = s.charAt(position);
                characterList.remove(c1);
                position++;
            }
            characterList.add(c);
            maxLen = Math.max(maxLen, window - position + 1);
        }


        return maxLen;
    }

    public int lengthOfLongestSubstringOptimized(String s) {
        int n = s.length(), ans = 0;
        Map<Character, Integer> map = new HashMap<>(); // current index of character
        // try to extend the range [i, j]
        for (int j = 0, i = 0; j < n; j++) {
            if (map.containsKey(s.charAt(j))) {
                i = Math.max(map.get(s.charAt(j)), i);
            }
            ans = Math.max(ans, j - i + 1);
            map.put(s.charAt(j), j + 1);
        }
        return ans;
    }
